Sometimes, you might not want to render an element given a condition. The rsx! macro will accept any tokens directly contained with curly braces, provided they resolve to a type that implements IntoIterator<VNode>. This lets us write any Rust expression that resolves to a VNode: rsx!({ if enabled { rsx!(cx, div {"enabled"}) } else { rsx!(cx, li {"disabled"}) }
}) A convenient way of hiding/showing an element is returning an Option<VNode>. When combined with and_then, we can succinctly control the display state given some boolean: rsx!({ a.and_then(rsx!(div {"enabled"}))
}) It's important to note that the expression rsx!() is typically lazy - this expression must be rendered to produce a VNode. When using match statements, we must render every arm as to avoid the no two closures are identical rule that Rust imposes: // this will not compile!
match case { true => rsx!(div {}), false => rsx!(div {})
} // the nodes must be rendered first
match case { true => rsx!(cx, div {}), false => rsx!(cx, div {})
