Again, because anything that implements IntoIterator<VNode> is valid, we can use lists directly in our rsx!: let items = vec!["a", "b", "c"]; cx.render(rsx!{ ul { {items.iter().map(|f| rsx!(li { "a" }))} }
}) Sometimes, it makes sense to render VNodes into a list: let mut items = vec![]; for _ in 0..5 { items.push(rsx!(cx, li {} ))
} rsx!(cx, {items} ) Lists and Keys When rendering the VirtualDom to the screen, Dioxus needs to know which elements have been added and which have been removed. These changes are determined through a process called "diffing" - an old set of elements is compared to a new set of elements. If an element is removed, then it won't show up in the new elements, and Dioxus knows to remove it. However, with lists, Dioxus does not exactly know how to determine which elements have been added or removed if the order changes or if an element is added or removed from the middle of the list. In these cases, it is vitally important to specify a "key" alongside the element. Keys should be persistent between renders. fn render_list(cx: Scope, items: HashMap<String, Todo>) -> DomTree { rsx!(cx, ul { {items.iter().map(|key, item| { li { key: key, h2 { "{todo.title}" } p { "{todo.contents}" } } })} })
} There have been many guides made for keys in React, so we recommend reading up to understand their importance: React guide on keys Importance of keys (Medium)

