For the sake of understanding, lets consider this example - a very simple UI declaration: rsx!( h1 {"hello world"} ) To get things started, Dioxus must first navigate to the container of this h1 tag. To "navigate" here, the internal diffing algorithm generates the DomEdit PushRoot where the ID of the root is the container. When the renderer receives this instruction, it pushes the actual Node onto its own stack. The real renderer's stack will look like this: instructions: [ PushRoot(Container)
]
stack: [ ContainerNode,
] Next, Dioxus will encounter the h1 node. The diff algorithm decides that this node needs to be created, so Dioxus will generate the DomEdit CreateElement. When the renderer receives this instruction, it will create an unmounted node and push into its own stack: instructions: [ PushRoot(Container), CreateElement(h1),
]
stack: [ ContainerNode, h1,
] Next, Dioxus sees the text node, and generates the CreateTextNode DomEdit: instructions: [ PushRoot(Container), CreateElement(h1), CreateTextNode("hello world")
]
stack: [ ContainerNode, h1, "hello world"
] Remember, the text node is not attached to anything (it is unmounted) so Dioxus needs to generate an Edit that connects the text node to the h1 element. It depends on the situation, but in this case we use AppendChildren. This pops the text node off the stack, leaving the h1 element as the next element in line. instructions: [ PushRoot(Container), CreateElement(h1), CreateTextNode("hello world"), AppendChildren(1)
]
stack: [ ContainerNode, h1
] We call AppendChildren again, popping off the h1 node and attaching it to the parent: instructions: [ PushRoot(Container), CreateElement(h1), CreateTextNode("hello world"), AppendChildren(1), AppendChildren(1)
]
stack: [ ContainerNode,
] Finally, the container is popped since we don't need it anymore. instructions: [ PushRoot(Container), CreateElement(h1), CreateTextNode("hello world"), AppendChildren(1), AppendChildren(1), PopRoot
]
stack: [] Over time, our stack looked like this: []
[Container]
[Container, h1]
[Container, h1, "hello world"]
[Container, h1]
[Container]
[] Notice how our stack is empty once UI has been mounted. Conveniently, this approach completely separates the VirtualDOM and the Real DOM. Additionally, these edits are serializable, meaning we can even manage UIs across a network connection. This little stack machine and serialized edits makes Dioxus independent of platform specifics. Dioxus is also really fast. Because Dioxus splits the diff and patch phase, it's able to make all the edits to the RealDOM in a very short amount of time (less than a single frame) making rendering very snappy. It also allows Dioxus to cancel large diffing operations if higher priority work comes in while it's diffing. It's important to note that there is one layer of connectedness between Dioxus and the renderer. Dioxus saves and loads elements (the PushRoot edit) with an ID. Inside the VirtualDOM, this is just tracked as a u64. Whenever a CreateElement edit is generated during diffing, Dioxus increments its node counter and assigns that new element its current NodeCount. The RealDom is responsible for remembering this ID and pushing the correct node when PushRoot(ID) is generated. Dioxus reclaims IDs of elements when removed. To stay in sync with Dioxus you can use a sparce Vec (Vec<Option>) with possibly unoccupied items. You can use the ids as indexes into the Vec for elements, and grow the Vec when a id does not exist. This little demo serves to show exactly how a Renderer would need to process an edit stream to build UIs. A set of serialized DomEditss for various demos is available for you to test your custom renderer against.

